import React from 'react';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import CssBaseline from '@material-ui/core/CssBaseline';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import Link from '@material-ui/core/Link';
import NavbarCliente from "../components/NavbarCliente";
import api from "../services/api";
import Axios from 'axios';
import data from "../data";
import Hero from "../components/Hero";
import Banner from "../components/Banner";
import CabeleireirosContainer from "../components/CabeleireirosContainer";

const Cabeleireiros = () => {
  return (
      <>
        <div className={classes.heroContent}>
          <Container maxWidth="sm">
            <Typography component="h5" variant="h4" align="center" color="textPrimary" gutterBottom>
             As minhas reservas
            </Typography>
            <div className={classes.heroButtons}>

            </div>
          </Container>
        </div>

      <Hero hero="cabeleireirosHero">;
  <Banner title="Cabeleireiros">


  </Banner>
  </Hero>
  <CabeleireirosContainer />
  </>
  );
};
